import React, { useState } from 'react';

const CreatList = (props) => {
  const [title, setTitle] = useState('');
  const handleChangeTitle = (event) => {
    setTitle(event.target.value);
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    console.log(title);
    props.history.push('/');
  };
  if (!auth.uid) return <Redirect to="/signin" />;
  return (
    <div className="container">
      <form onSubmit={handleSubmit} className="white">
        <h5 className="grey-text text-darken-3">Create list</h5>
        <div className="input-field">
          <label htmlFor="title">title</label>
          <input type="text" id="title" onChange={handleChangeTitle} />
        </div>
       
       
        <div className="input-field">
          <button className="btn pink light-1 z-depth-0">create</button>
        </div>
      </form>
    </div>
  );
};

export default CreatList;
